<!doctype html>

<html lang="de">

<head>
    <meta charset="utf-8">

    <title>Rabenmap</title>
    <meta name="description" content="Rabenmap">
    <meta name="author" content="Carsten Herbst">
    <style>
        .flurstueck {
            fill-opacity: 0;
            fill: whitesmoke;
            transition: 0.3s;
            cursor: pointer;
        }

        .flurstueck_mitDaten {
            fill-opacity: 0.5;
            fill: green;
            transition: 0.3s;
            cursor: pointer;
        }

        .flurstueck:hover {
            fill-opacity: 0.7;
        }

        .flurstueck_mitDaten:hover {
            fill-opacity: 0.9;
        }

        .flurDetails {
            display: none;
            position: fixed;
            z-index: 1;
            padding-top: 100px;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            overflow: auto;
            background-color: rgb(0, 0, 0);
            background-color: rgba(0, 0, 0, 0.8);
        }

        .flurDetails-content {
            background-color: #fefefe;
            margin: auto;
            padding: 20px;
            border: 1px solid #888;
            width: 80%;
            overflow: auto;
            max-width: 530px;
            border-radius: 25px;
        }

        .close {
            color: #aaaaaa;
            float: right;
            font-size: 28px;
            font-weight: bold;
        }

        .close:hover,
        .close:focus {
            color: #000;
            text-decoration: none;
            cursor: pointer;
        }

        .detailcontainer {
            margin: 0 auto;
            display: grid;
            grid-gap: 1rem;
        }

        @media (min-width: 1000px) {
            .detailcontainer {
                grid-template-columns: repeat(2, 1fr);
            }

            .flurDetails-content {
                max-width: 900px;
            }
        }
    </style>
    <script>
        var data;
        var password; 
        password=prompt('Passwort kriegst du bei Carsten',' '); 
        getData();
        
        window.onclick = function (event) {
            var flurDetails = document.getElementById("flurDetails");
            if (event.target == flurDetails) {
                flurDetails.style.display = "none";
            }
        }

        function closeDetails() {
            var flurDetails = document.getElementById("flurDetails");
            flurDetails.style.display = "none";
        }

        function getData() {
            var xmlhttp = new XMLHttpRequest();
            xmlhttp.onreadystatechange = function () {
                if (this.readyState == 4 && this.status == 200) {
                    var secret_data = JSON.parse(this.responseText);
                    var id = secret_data.id;
                    var key = secret_data.key;
                    xmlhttp.onreadystatechange = function () {
                        if (this.readyState == 4 && this.status == 200) {
                            data = JSON.parse(this.responseText);
                            data.values.shift();
                            data.values.forEach(element => {
                                console.log("flst_" + element[2]);
                                document.getElementById("flst_" + element[2]).classList.add("flurstueck_mitDaten");
                                document.getElementById("flst_" + element[2]).classList.remove("flurstueck");
                            });
                        }
                    };
                    xmlhttp.open("GET", "https://sheets.googleapis.com/v4/spreadsheets/" + id + "/values/Formularantworten?alt=json&key=" + key, true);
                    xmlhttp.send();
                }
            };
            xmlhttp.open("GET", "https://h3rbst.github.io/Rabenmap/" + password + ".json", true);
            xmlhttp.send();
        }

        function showDetails(flurstueck) {
            resetDetails();
            var flurDetails = document.getElementById("flurDetails");
            flurDetails.style.display = "block";
            console.log(flurstueck);
            var index = data.values.findIndex(x => x[2] == flurstueck);
            console.log(index);
            if (index == -1) {
                return;
            }
            document.getElementById("name").innerHTML = data.values[index][1];
            document.getElementById("flurstueck").innerHTML = "Flurst√ºck " + data.values[index][2];
            document.getElementById("adresse").innerHTML = data.values[index][3];
            // document.getElementById("mail").innerHTML = data.values[index][4];
            // document.getElementById("mail").href = "mailto:" + data.values[index][4];
            document.getElementById("phone").innerHTML = data.values[index][5];
            document.getElementById("phone").href = "tel:" + data.values[index][5];
            var bild = data.values[index][6].replace("https://drive.google.com/open?id=", "");
            if (bild == "") {
                document.getElementById("picture").src = null;
                document.getElementById("picture").style.visibility = "hidden";
                return;
            }
            document.getElementById("picture").style.visibility = "visible";
            document.getElementById("picture").src = "https://drive.google.com/uc?export=view&id=" + bild;
        }
    </script>
